  // console.log('BrandCollectionPage fired');
  // console.log(match);
  return (
    <div>
      <Route path={`${match.path}`} component={BrandCollection} />
      <Route
        exact
        path={`${match.path}/brand/:productId`}
        component={BrandProductItem}
      />
    </div>
  );
};

export default BrandPage;
